    <td>{i}</td>)
    return(
        <>

        <table className="table" >

            <tr className='table1'>
                <th>numeros gerados</th>
            </tr>

             <td className='table2'>
              <table className="table">
                <tr>
                    {listaNumeros}
                </tr>
             </table>
            </td>  
        </table>
       </>



    )
}
export default GerarNumeros;
